import React, { useEffect } from "react";
import Head from "next/head";
import { annotate } from "rough-notation";
if (process.browser) {
  const e = document.querySelector("name");
}
const annotation = annotate(e, { type: "underline" });
annotation.show();

const IntroText = () => {
  <Head>
    <title>Niels de Visser | Portfolio</title>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/1.12.4/jquery.min.js"></script>
  </Head>;
  return (
    <div>
      Hi I'm
      <i>
        <span id="name">
          <b> Niels</b>
        </span>
      </i>
      ,
      <br />
      And I've recently decided to start my career in the tech space. I've
      succesfully retrained as an Fullstack software Developer
      <b>
        <i> Northcoders Developer Pathway </i>
      </b>
      in
      <i>
        <b> Manchester</b>
      </i>
      . Read more about my starting experience on /my blog/.
    </div>
  );
};

export default IntroText;
